import {Form,Main,Input,Button,Col,Label,TextArea,InputLabel} from './style'
const DiscussForm=()=>{
    return( 
         <Main><Form>
             <Col><InputLabel style={{display:"flex",flexFlow:"column"}}>     <Label for="html">HTML</Label><Input/></InputLabel>
             <InputLabel style={{display:"flex",flexFlow:"column"}}>     <Label for="html">HTML</Label><Input/></InputLabel>
  </Col><Col><InputLabel style={{display:"flex",flexFlow:"column"}}>     <Label for="html">HTML</Label><Input/></InputLabel>
  <InputLabel style={{display:"flex",flexFlow:"column"}}>     <Label for="html">HTML</Label><Input/></InputLabel></Col>
        <Col> <InputLabel style={{display:"flex",flexFlow:"column"}}> <Label for="html">HTML</Label><TextArea/></InputLabel></Col>
        </Form>
        <Button>GET A QUATE</Button></Main>
        )
}
export default DiscussForm;
